/**************
 * Management for LiveSearch V4.2
 *  December 20th 2020
 *  http://codecanyon.net/item/live-search-searchengine-for-your-website/86875?ref=themac
 **************/
  "use strict";
  $(document).ready(function() { 

    $('.toolboxes').masonry({itemSelector:'.toolbox'});

  	$('.tttop').tooltip({placement:'top'});

    /*****
     * focus login fields
    *****/
    if ($("#loginF").length) {
    	if (!$("#loginF input[name='user']").val()) {
  			$("#loginF input[name='user']").focus();
    	} else {
    		$("#loginF input[name='pass']").focus();
    	}
    }

    /*****
     * clear searchstrings
    *****/
    $(".js-bn-clearSrchStr").on("click",function() {
    	var thisBtn = $(this);
  	  $.ajax({
        type: "POST",
        url: "lsMngr.ajax.php",
        dataType: 'json',
        async: false,
        data: {"action":"clearSrchStr"},
        success: function(msgObj) {
          if (msgObj.error) {
            new PNotify({title: "Errors occured",text: msgObj.error, type: "error"});
          } else {
          	$(thisBtn).prop("disabled",true).addClass("btn-success").removeClass("btn-primary").prepend('<i class="fa fa-check"></i> ');
            new PNotify({title: "Operations succeeded",text: msgObj.success, type: "success"});
          }
        }
      });
  	});

    /*****
     * clear searchresults
    *****/
    $(".js-bn-clearSrch").on("click",function() {
    	var thisBtn = $(this);
  	  $.ajax({
        type: "POST",
        url: "lsMngr.ajax.php",
        dataType: 'json',
        async: false,
        data: {"action":"clearSrch"},
        success: function(msgObj) {
          if (msgObj.error) {
            new PNotify({title: "Errors occured",text: msgObj.error, type: "error"});
          } else {
          	$(thisBtn).prop("disabled",true).addClass("btn-success").removeClass("btn-primary").prepend('<i class="fa fa-check"></i> ');
            new PNotify({title: "Operations succeeded",text: msgObj.success, type: "success"});
          }
        }
      });
  	});

    /*****
     * clear cache
    *****/
    $(".js-bn-clearCache").on("click",function() {
    	var thisBtn = $(this);
  	  $.ajax({
        type: "POST",
        url: "lsMngr.ajax.php",
        dataType: 'json',
        async: false,
        data: {"action":"clearCache"},
        success: function(msgObj) {
          if (msgObj.error) {
            new PNotify({title: "Errors occured",text: msgObj.error, type: "error"});
          } else {
          	$(thisBtn).prop("disabled",true).addClass("btn-success").removeClass("btn-primary").prepend('<i class="fa fa-check"></i> ');
          	$(".badge",thisBtn).text(0);
            new PNotify({title: "Operations succeeded",text: msgObj.success, type: "success"});
          }
        }
      });
  	});

    /*****
     * cache files
    *****/
    $(".js-btn-cacheFiles").on("click",function() {
    	var thisBtn = $(this);
    	var cacheInitInfo;
    	$.ajax({
        type: "POST",
        url: "lsMngr.ajax.php",
        dataType: 'json',
        async: false,
        data: {"action":"cacheFiles"},
        success: function(msgObj) {
          if (msgObj.error) {
            cacheInitInfo = msgObj.error;
          }
        }
      });

      $(thisBtn).prop("disabled",true).prepend('<i class="fa fa-spinner fa-pulse"></i> ');

    	var cfmessageTable = '<table class="table table-striped table-hover table-bordered table-condensed status-table"><tbody>'+
    		'<tr><td><strong>Temporary Files/Links</strong></td><td class="cfTemp text-right"><span>0</span> <i class="fa fa-spinner fa-pulse fa-fw"></i></td></tr>'+
    		'<tr><td><strong>Indexed Files/Urls</strong></td><td class="cfIndexed text-right"><span>0</span> <i class="fa fa-spinner fa-pulse fa-fw"></i></td></tr>'+
    		'<tr><td><strong>Indexed Files/Images</strong></td><td class="cfImg text-right"><span>0</span> <i class="fa fa-spinner fa-pulse fa-fw"></i></td></tr>'+
    		'<tr><td><strong>Indexed Files/PDFs</strong></td><td class="cfPdf text-right"><span>0</span> <i class="fa fa-spinner fa-pulse fa-fw"></i></td></tr>'+
    		'</tbody></table>';

    	if (cacheInitInfo) {
    		cfmessageTable = '<div class="alert alert-info">' + cacheInitInfo + '</div>' + cfmessageTable;
    	}
  		var bbCacheFiles = bootbox.dialog({
  			closeButton: false,
  			message:'<div class="alert alert-warning status-alert"><div class="row">'+
  				'<div class="col-xs-4 text-right"><i class="fa fa-circle-o-notch fa-spin fa-4x status-icon"></i></div>'+
  				'<div class="col-xs-8"><h3 class="status-info">Indexing Site...</h3></div>'+
  				'</div></div>'+//row well
  				cfmessageTable+
  				'</div>',//cacheFilesStatus
  			className: "bb-CacheFiles",
        buttons: {
          "cancel": { className: "btn-default disabled bbOK", label: "Processing ...", callback: function() { bootbox.hideAll(); } }
        },
        onShown: function() {
          var cfStatusCheck = setInterval(
            function() {
              $.ajax({
                type: "POST",
                url: "lsMngr.ajax.php",
                dataType: 'json',
                async: false,
                data: {"action":"getCacheFilesStatus"},
                success: function(msgObj) {
                  $(".status-info",bbCacheFiles).text(msgObj.statusMessage);
                  $(".status-table .cfTemp span",bbCacheFiles).text(msgObj.tempFiles);
                  $(".status-table .cfIndexed span",bbCacheFiles).text(msgObj.dataFiles);
                  $(".status-table .cfImg span",bbCacheFiles).text(msgObj.dataImages);
                  $(".status-table .cfPdf span",bbCacheFiles).text(msgObj.dataPdfs);
                  if (msgObj.tempFilesFinished) {
                    $(".status-table .cfTemp i",bbCacheFiles).removeClass("fa-spinner fa-pulse").addClass("fa-check text-success");
                  }
                  if (msgObj.dataFilesFinished) {
                    $(".status-table .cfIndexed i",bbCacheFiles).removeClass("fa-spinner fa-pulse").addClass("fa-check text-success");
                    $(".btn-default.bbOK",bbCacheFiles).removeClass("btn-default disabled").addClass("btn-primary").text("Close");
                  }
                  if (msgObj.finished) {
                    $(".status-alert",bbCacheFiles).removeClass("alert-warning").addClass("alert-success");
                    $(".status-icon",bbCacheFiles).removeClass("fa-circle-o-notch fa-spin").addClass("fa-check text-success");
                    $(".status-table .cfImg i,.status-table .cfPdf i",bbCacheFiles).removeClass("fa-spinner fa-pulse").addClass("fa-check text-success");
                    new PNotify({title: "Operations succeeded",text: msgObj.success, type: "success"});
                    $(thisBtn).prop("disabled",true).addClass("btn-success").removeClass("btn-primary")
                    $(thisBtn).parent().attr("title","just indexed, to cache files again, please reload page").tooltip();
                    $("i",thisBtn).removeClass("fa-spinner fa-pulse").addClass("fa-check");
                    clearInterval(cfStatusCheck);
                  }
                }
              });         
            }, 2500);
        }
      });
  	
    });


   });
